function Umls(props) {




    return (

            <div>


                <div className="InputUml">
                    <label>OriginalUml: </label><h2> {props.items.map(umllist=> (<Umls uml={umllist.umlData}/>))}
                    </h2>


                </div>
            </div>

    )
        ;
}

export default Umls;
